import BingeStats from "./components/BingeStats/BingeStats";

function App() {
  return (
    <div className="App">
        {/*<Link to="/">Home</Link>*/}
        <header className="App-header">
          <h1>Horror Movie Binge 2020</h1>
          <p>Goal is to hit 365 for the year</p>
        </header>
        <div>
            <Route></Route>
            <BingeStats/>
            <hr/>
            <h3>Movies watched in chronological order:</h3>
            <MoviesList />
        </div>
    </div>
  );
}

export default App;
